import { Container, Row, Col } from "react";
import "./App.css";

export default function Header() {
  return (
    <div>
      <Container>
        <Row>
          <Col>
            <div class="topnav">
              <h2>xomato Restaurant</h2>
              <div>Order | Eat | Enjoy </div>
            </div>
          </Col>
          <Col>
            <div>Welcome to our Restaurant</div>
          </Col>
        </Row>
      </Container>
    </div>
  );
}
